import "./App.css";
import ReactDOM from "react-dom";
import image from "./cal.png";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import React, { useState, useRef } from "react";
import {
  faArrowRight,
  faCoffee,
  faRightLeft,
} from "@fortawesome/free-solid-svg-icons";
import { FoodCard } from "./components/card";
import db from "./DB";
import { FestBanner } from "./components/banner";
import dimg from "./DB/assets/paper.png";
import mimg from "./DB/assets/Vec.png";
import lin from "./DB/assets/lin.png";

function App() {
  const { weeklySpecial, Topseller, Featured, fest } = db;

  return (
    <div className="App">
      <div className="weekly">
        <img src=""></img>
        <div className="wtext">
          <p>Weekly Special</p>
          <img className="line" src={lin}></img>
        </div>
        <div className="vtext">
          <p>view all </p>
          <FontAwesomeIcon className="ico" icon={faArrowRight}></FontAwesomeIcon>
        </div>
        <div>

        </div>
      </div>

      {/* //top */}

      <div className="top">
        <div className="wtext">
          <p>Top seller</p>
          <img className="line" src={lin}></img>
        </div>

        <div className="vtext">
          <p>view all </p>

          <FontAwesomeIcon
            className="ico"
            icon={faArrowRight}
          ></FontAwesomeIcon>
        </div>

        {Topseller.map((datum) => {
          return <FoodCard datum={datum} />;
        })}
      </div>

      <div className="fea">
        <div className="wtext">
          <p>Featured Products</p>
          <img className="line" src={lin}></img>
        </div>

        <div className="vtext">
          <p>view all </p>

          <FontAwesomeIcon
            className="ico"
            icon={faArrowRight}
          ></FontAwesomeIcon>
        </div>

        {weeklySpecial.map((datum) => {
          return <FoodCard datum={datum} />;
        })}
      </div>

      {/* 
  //fest */}

      <div className="fest">
        <div className="wtext">
          <p>Festival Offers</p>
          <img className="line" src={lin}></img>
        </div>

        {fest.map((datum) => {
          return <FestBanner datum={datum} />;
        })}
      </div>

      <div className="down">
        <div>
          <img className="dimge" src={dimg}></img>
        </div>

        <p className="Sub">Subscribe to our newsletter</p>

        <p
          className="su
      "
        >
          No spam, promise! You will receive weekly news about the best deals
          and basket suggestions.
        </p>

        <input className="in"></input>

        <p
          className="em
      "
        >
          Email
        </p>

        <div>
          <img className="vimge" src={mimg}></img>
        </div>
      </div>
    </div>
  );
}

export default App;
